import React from 'react';

import { FormContainer, ContentCard, InfoContainer, NameCard } from './style';

const OrderInfoForm = () => {
    return (
        <FormContainer>
            <ContentCard style={{flexDirection:'column', padding:'50px 0'}}>
                <InfoContainer style={{margin:'15px 0'}}>
                    <NameCard style={{fontSize: '1.3rem'}}>주소</NameCard>
                    <input 
                        type="text" 
                        style={{
                            display:'inline-block',
                            width:'85%',
                            height: '25px',
                            border:'1px solid #8c8a89',
                            borderRadius: '5px',
                        }}/>
                </InfoContainer>
                <InfoContainer style={{margin:'15px 0'}}>
                    <NameCard style={{fontSize: '1.3rem'}}>카드번호</NameCard>
                    <input 
                        type="text" 
                        style={{
                            display:'inline-block',
                            width:'85%',
                            height: '25px',
                            border:'1px solid #8c8a89',
                            borderRadius: '5px',
                        }}/>
                </InfoContainer>
            </ContentCard>
        </FormContainer>
    );
};

export default OrderInfoForm;
